DESCRIBE orders;
-- 
-- Заполняем данными таблицу "Корзины покупателей".
-- 
-- Обновить инфорамацмю в таблице "Корзины покупателей",
-- после вставки данных.
-- 
-- Обновляем дату создания записи
UPDATE orders SET created_at=DATE_FORMAT(created_at,'2020-%m-%d %T')
-- 
-- Обновляем цены
UPDATE orders SET cost = FLOOR(50 + RAND() * 1000); -- FLOOR - отбросить дробную часть
-- 
-- Обновляем номер заказа
UPDATE orders SET order_number = CAST(FLOOR(1000 + RAND() * 8999) AS char(25)); -- FLOOR - отбросить дробную часть
-- 
-- Обновляем дату заказа
UPDATE orders SET order_date = DATE_FORMAT(order_date,'2020-%m-%d %T')
-- UPDATE web_shop.orders SET order_number='1389'WHERE id=174;
UPDATE orders SET order_date = DATE_FORMAT(order_date,'2020-%m-%d %T')

ALTER TABLE orders MODIFY COLUMN order_number varchar(25) NOT NULL UNIQUE COMMENT 'Идентификатор типа товара';

UPDATE orders SET order_ditails = delivery_service;


